// StateDetails.js

import React from 'react';
import { useParams } from 'react-router-dom';

const StateDetails = ({ stateList }) => {
  const { stateId } = useParams();
  const state = stateList.find((state) => state._id === parseInt(stateId, 10));

  if (!state) {
    return <div>State not found</div>;
  }

  return (
    <div>
      <h2>{state.name} Details</h2>
      <p>Culture: {state.details.culture}</p>
      <p>Dress: {state.details.dress}</p>
      <p>Food: {state.details.food}</p>
      <p>Festivals: {state.details.festivals}</p>
      <p>Temples: {state.details.temples}</p>
    </div>
  );
};

export default StateDetails;
